using NUnit.Framework;
using Problems.hackerrank.Strings;
using System;
using System.Collections.Generic;
using System.Linq;
using System.Text;
using System.Threading.Tasks;

namespace ProblemTest.hackerrank
{
    [TestFixture]
    public class AlternatingCharactersTest
    {
        [Test]
        public void AlternatingCharactersSolution1Test()
        {
            var d = new List<Tuple<string, int>>();
            d.Add(new Tuple<string, int>("", 0));
            d.Add(new Tuple<string, int>("a", 0));
            d.Add(new Tuple<string, int>("b", 0));
            d.Add(new Tuple<string, int>("ab", 0));
            d.Add(new Tuple<string, int>("aab", 1));
            d.Add(new Tuple<string, int>("abb", 1));
            d.Add(new Tuple<string, int>("aabb", 2));
            d.Add(new Tuple<string, int>("aabbabaa", 3));
            d.Add(new Tuple<string, int>("", 49979));
            d.Add(new Tuple<string, int>("", 50062));
            d.Add(new Tuple<string, int>("", 49889));
            d.Add(new Tuple<string, int>("", 50005));
            d.Add(new Tuple<string, int>("", 50069));

            List<Task<Tuple<int, int>>> t = new List<Task<Tuple<int, int>>>();
            var i = 0;
            foreach(var item in d)
            {
                int tmpc = i++;
                var tmp = item;
                t.Add(Task.Factory.StartNew<Tuple<int, int>>(() =>
                {
                    var p = new AlternatingCharacters();
                    var res = p.Solution1(item.Item1);
                    Assert.AreEqual(item.Item2, res);
                    return new Tuple<int,int>(res,tmpc);
                }));
                
            }

            Task.WaitAll(t.ToArray());
            var output=t.OrderBy(c=>c.Result.Item2).Select(c=>c.Result.Item1).ToList<int>();
            for (int j = 0; j < d.Count; j++)
            {
                Assert.AreEqual(d[j].Item2, output[j]);
            }
            
            Console.WriteLine("done");

        }
    }
}
